  false,\n\t\"url\": null,\n\t\"notes\": \"This project supports restoration activities
  at Laysan Island. Staff and volunteers continue efforts to eradicate alien invasive
  species Indian dropseed (Sporobolus pyramidatus), Bermuda grass (Cynadon dactylon),
  and Indian fleabane (Pluchea indica) by physical removal, chemical treatment and
  conduct post monitoring to prevent reestablishment. Volunteers continue long-term
  monitoring, mapping, and control of the Common Sandbur and Swinecress (Coronopus
  didymus). Tobacco (Nicotannia tobaccum) and Hairy Horseweed (Conyza bonariensis)
  are removed opportunistically and are considered low priority at this time. Native
  plant propagation and outplanting is conducted in areas free of alien invasivespecies.
  Crew members conduct regular monitoring of vertebrate species for population health
  and ants are monitored for early detection of any new species arrivals.\",\n\t\"license_title\":
